import { CommonModule } from "@angular/common";

import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <div class="div">
      <div class="div-2">
        <div class="div-3">
          <div class="column">
            <span class="span">
              <div class="div-4">Plant trees for free.</div>
              <div class="div-5">Make the planet better.</div>
            </span>
          </div>
          <div class="column-2">
            <span class="span-2">
              <div class="div-6">Sign in</div>
              <div class="div-7">Username</div>
              <div class="div-8"><div class="div-9"></div></div>
              <div class="div-10">PASSWORD</div>
              <div class="div-11"><div class="div-12"></div></div>
              <span class="span-3">Login</span>
              <span class="span-4">
                <div class="div-13">Otherwise, please</div>
                <div class="div-14">Register here</div>
              </span>
            </span>
          </div>
        </div>
      </div>
    </div>
  `,
  styles: [
    `
      .div {
        justify-content: center;
        align-self: stretch;
        background-color: var(--whitePure, #081c15);
        display: flex;
        flex-direction: column;
        padding: 50px 16px;
      }
      .div-2 {
        margin: 138px 0 75px;
      }
      @media (max-width: 991px) {
        .div-2 {
          max-width: 100%;
          margin: 40px 0;
        }
      }
      .div-3 {
        gap: 20px;
        display: flex;
      }
