        .div-5 {
          max-width: 100%;
        }
      }
      .column-2 {
        display: flex;
        flex-direction: column;
        line-height: normal;
        width: 29%;
        margin-left: 20px;
      }
      @media (max-width: 991px) {
        .column-2 {
          width: 100%;
        }
      }
      .span-2 {
        justify-content: center;
        display: flex;
        flex-grow: 1;
        flex-direction: column;
      }
      @media (max-width: 991px) {
        .span-2 {
          margin-top: 32px;
        }
      }
      .div-6 {
        color: var(--greenDark, #e8f5f1);
        white-space: nowrap;
        font: 400 23px/139% Roboto, sans-serif;
      }
      @media (max-width: 991px) {
        .div-6 {
          white-space: initial;
