        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }
      .div-10 {
        color: var(--greenDark, #e8f5f1);
        letter-spacing: 2px;
        text-transform: uppercase;
        margin-top: 4px;
        font: 400 12px/32px Roboto, sans-serif;
      }
