        margin-top: 4px;
        flex-direction: column;
        justify-content: center;
      }
      .div-12 {
        justify-content: center;
        align-items: center;
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }
      .span-3 {
        color: var(--cardsWhite, #081c15);
        white-space: nowrap;
        justify-content: center;
        align-items: center;
        border-radius: 6px;
        box-shadow: 0px 4px 61px 0px rgba(45, 106, 79, 0.4);
        background-color: var(--cardsMainColor, #f4fbf9);
        margin-top: 32px;
        padding: 11px 60px;
        font: 600 18px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .span-3 {
          white-space: initial;
          padding: 0 20px;
        }
      }
      .span-4 {
        align-items: center;
        display: flex;
        margin-top: 32px;
        justify-content: space-between;
        gap: 6px;
      }
      .div-13 {
        color: var(--greenDark, #e8f5f1);
        margin: auto 0;
        font: 400 14px Poppins, sans-serif;
      }
      .div-14 {
        color: var(--greenDark, #e8f5f1);
        font: 600 16px Poppins, sans-serif;
      }
    `,
  ],
})
export class MyComponent {}
